import React, { Component } from "react";
import ReactDOM from "react-dom";
import { Provider } from "react-redux";
import { I18nextProvider } from "react-i18next";
import i18next from "i18next";

import common_en from "locales/en/translation.json";
import common_th from "locales/th/translation.json";

import store from "./../store/react-redx-store";
import FarmerAccounts from "./client/route";

i18next.init({
  interpolation: { escapeValue: false }, // React already does escaping
  lng: "en", // language to use
  resources: {
    en: {
      translation: common_en, // 'common' is our custom namespace
    },
    th: {
      translation: common_th,
    },
  },
});

export default function App() {
  return (
    <React.Fragment>
      {process &&
        process.browser &&
        ReactDOM.render(
          <Provider store={store}>
            <I18nextProvider i18n={i18next}>
              <FarmerAccounts />
            </I18nextProvider>
          </Provider>,
          document.getElementById("root")
        )}
    </React.Fragment>
  );
}
